import React from 'react';
import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    Container
}from 'reactstrap';

export const Navs=()=>{
    return(
        <Navbar>
            <Container>
                <NavbarBrand><h1>Routes</h1></NavbarBrand>
                <Nav>
                    <NavItem>Items</NavItem>
                </Nav>
            </Container>
        </Navbar>
    )
};
